import React, { useState } from 'react';
import axios from 'axios';
import Navbar from '../Navbar';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import './Registration.css';

function Registration() {
    const[reg,setReg]=useState({
      empname:"",
      age:"",
      empid:"",
      typeofemp:"",
      email:"",
      password:"",
      image:""
    })

    const onChg=(e)=>{
      if(e.target.name==image){
        setReg({...reg,[file[0]]:e.target.file});
      }else{
        setReg({...reg,[e.target.name]:e.target.value});
      }
      // setReg({...reg,[e.target.name]:e.target.value});
      console.log(reg)
    }

    const submitForm=(e)=>{
      e.preventDefault();
      const form=new FormData()
      form.append("empnamename",e.target.name)
      form.append("image",e.target.file)

      console.log(reg);
      axios.post("http://127.0.0.1:8080/reguser",reg)
      .then((data)=>{
        console.log(data)
        alert("Registered successfully-")
  
      })
      .catch((error)=>{
        console.log(error)
      })

      setReg({
        empname:"",
        age:"",
        empid:"",
        typeofemp:"",
        email:"",
        password:"",
        image:""
      })
    }
    
  return (
    <div>
      <Navbar />
      <div className="registrationformcontainer">
        <h2 className="registrationformheading">Employee Registration</h2>

        <Form onSubmit={submitForm}>

          <div className="registrationformrow">
            <div className="registrationformgroup">
              <Form.Label>Employee Name</Form.Label>
              <Form.Control type="text" placeholder="Enter your name" value={reg.name} name='empname' onChange={onChg} required />
            </div>
            <div className="registrationformgroup">
              <Form.Label>Age</Form.Label>
              <Form.Control placeholder="Enter your age" name='age' value={reg.age} onChange={onChg} required />
            </div>
          </div>

          <div className="registrationformrow">
            <div className="registrationformgroup">
              <Form.Label>Employment ID</Form.Label>
              <Form.Control type="number" placeholder="Enter your Employment ID" value={reg.empid} name='empid' onChange={onChg} required />
            </div>

            <div className="registrationformgroup">
              <Form.Label>Type of Employment</Form.Label>
              <Form.Control type="text" placeholder="Enter type of Employment" value={reg.typeofemp} name='typeofemp' onChange={onChg} required />
            </div>
          </div>

          <div className="registrationformrow">
            <div className="registrationformgroup">
              <Form.Label>Email</Form.Label>
              <Form.Control type="email" placeholder="Enter your email" value={reg.email} name='email' onChange={onChg} required />
            </div>

            <div className="registrationformgroup">
              <Form.Label>Password</Form.Label>
              <Form.Control type="password" placeholder="Enter your password" value={reg.password} name='password' onChange={onChg} required />
            </div>
          
          </div>
          <div className="registrationformrow">
          <div className="registrationformgroup">
              <Form.Label>Image</Form.Label>
              <Form.Control type="file" placeholder="Upload image" value={reg.image} name='file' onChange={onChg} required />
            </div>
          </div>


          <div className="registrationformrow">
            <div className="registrationformgroup full-width">
              <Form.Check type="checkbox" label="I agree to the terms and conditions" required />
            </div>
          </div>

          <div className="registrationformrow">
            <div className="registrationformgroup full-width">
              <Button variant="primary" type="submit" className="registrationsubmitbutton">
                Submit
              </Button>
            </div>
          </div>
        </Form>
      </div>
    </div>
  );
}

export default Registration;
